import React from 'react';
import FormSignup from './FormSignup';
import { BrowserRouter as Router } from 'react-router-dom';
import { Routes, Route } from 'react-router-dom';
import './App.css';
import Form from './Form';

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/' element={<FormSignup />} />
      </Switch>
    </Router>
  );
}

export default App;
